import { motion } from "framer-motion";
import styled from "styled-components";
import SearchLayout from "../layout/search.layout";
import MoreArticlesLayout from "../layout/moreArticles.layout";
import TopicsLayout from "../layout/topics.layout";

const SearchPageStyle = styled(motion.div)`
  display: flex;
  flex-direction: column;
  .articlesList {
    margin-top: 50px;
    position: relative;
    width: 93vw;
    left: 5vw;
    display: flex;
    flex-wrap: wrap;
  }
`;

const SearchPage = () => (
  <SearchPageStyle>
    <SearchLayout />
    <MoreArticlesLayout length={10} />
    <TopicsLayout />
    <AuthorsOfTheMonth
      styles=".NewestAuthors{display : none}"
      title="Top elite authors"
    />
  </SearchPageStyle>
);

export default SearchPage;
